@mx [τ, ρ]  I can’t verify the information because I don’t have access to validator logs. I believe you need to ensure a fair and healthy competitive environment.

I don’t understand why, after intentionally lowering the quality of my model to balance scores across validators, my trust score actually increased to nearly 1. This clearly doesn't benefit the subnet — the model quality decreases, yet it’s rated more favorably?

A clear example is the case I previously mentioned — UID 130. Despite having poor quality and completing very few tasks over a long period, it still exists to this day??? I think you need to investigate this issue to bring more transparency to the subnet.

Testnet now has:
* new validation;
* duels (althought the testnet activity is very low and it's almost impossible to get a duel);
* old incentive design (to be updated asap).
